export default function Menu() {
  const menuStyle = {
    display: 'flex',
     // Adjust this property for different spacing options
  };

  return (
    <div style={menuStyle}>
      <a href='#'>Home</a>
      <a href='#'>About Us</a>
      <a href="#">Menu</a>
      <a href='#'>Contact Us</a>
    </div>
  );
}
